import React from 'react';

const AuthorList = ({authors}) => {
    return (
    <table>
    <thead>
    <tr>
    <th>Nom</th>
    <th>Date de décès</th>
    </tr>
    </thead>
    <tbody>
    {authors.map(author => (
    <tr key={author.eid}>
    <td>{author.title}</td>
    </tr>
    ))}
    </tbody>
    </table>
    );
    };

export default AuthorList;
